import React from 'react';



export default function listing() {

    const urlAPI = 'https://api.pokemontcg.io/v1/cards';
    fetch(urlAPI)
        .then(response => {
            if (!response.ok) {
                throw new Error();
            }
            return response.json();
        });

};
